import React from "react";
import Paper from "@material-ui/core/Paper";
import "./Header.css";
function Header() {
  return (
    <Paper style={{ padding: "10px" }} elevation={3}>
      <h1 style={{ fontFamily: cursive }} className="site-name">
        React App
      </h1>
    </Paper>
  );
}

export default Header;
